class authService {

  signIn(email, password){
    fetch(`http://localhost:3000/db/clients`, {email, password})
    .then(resp => {
      console.log(resp)
    })
    .catch(err => {
      console.log(err)
    })
  }

  newCliente(email, password){
    fetch(`http://localhost:3000/db/clients`, {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify({
        email: email,
        password: password 
      })
    })
  }
}
